      | 366238 -> { ItemTypeData.id= 366238; name= "Faction Booster Caldari (30-Day)"; published= false; description= "Faction boosters are biometric identification chips issued by major factions throughout New Eden. Once activated they uniquely identify the user as a supporter of the issuing faction. Corporations operating on behalf of the faction will then be authorized to increase rewards to that individual."; marketGroupId= None; groupId= 354641; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 366432 -> { ItemTypeData.id= 366432; name= "Imperial Viziam Laser Rifle"; published= false; description= "The laser rifle is a continuous wave, medium range weapon. Targets are ‘painted’ with a high intensity beam that deals sustained, focused damage in a concentrated area to maximize damage potential.  At the core of the weapon is the thermal cavity, within which an optic spacer converges and blends three individually pumped beams into a single coherent output. The additional distortion introduced by each beam results in weakened output at close range, but as the weapon warms up to mean operating temperature the wavelength stabilizes and the damage output increases significantly, producing a weapon of unmatched precision and lethality in mid-range combat.  Heat build-up is typically managed by a self-regulating failsafe, a device used to forcibly shut the weapon off at regular intervals, flushing heat from its internal workings and preventing lethal feedback to the user, but most laser rifles in the field have been altered to bypass the built-in safety protocols."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366529 -> { ItemTypeData.id= 366529; name= "State Ishukone Nanohive"; published= false; description= "The nanohive is one of the most advanced pieces of battlefield technology to date, able to convert formatted matter from its limited internal stores and reorganize it into any kind of ammunition. When a soldier approaches, the nanohive receives an automated request from the Cortex Holographic Interface instructing swarms of self-replicating construction nanites to begin producing whatever type of ammunition that soldier requires.  The device itself is composed of three major parts: a composite carbon polymer shell, heavily shielded to prevent potentially disruptive ambient electronic interference; a low-level replicator assembly housing the initial seed swarm; and a C11 power core capable of producing class-one containment fields, confining the nanite swarm as it replicates to its maximum sustainable mass. There is, however, no central computer; each nanite is born with a complete set of instructions on how to create every known variety of ammunition round."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366723 -> { ItemTypeData.id= 366723; name= "'Neo' Commando M/1-Series"; published= false; description= "The Commando dropsuit is a variable combat unit capable of reacting to battlefield threats as they emerge. Built using a repurposed heavy frame, the suit is designed for maximum offensive flexibility. The streamlined frame does away with extraneous armor layers, using the augmented power of the exoskeleton to instead shoulder the weight and bulk of two light-class weapons.    Stripped of all but the most necessary protection, the Minmatar Commando is the fastest, most agile heavy frame on the battlefield. Jury-rigged into the subframe are off-the-shelf damage modifiers able to improve the damage yield of all light-class projectile and explosive weaponry wielded by the user.    The Commando is the ultimate suppression fighter. What the suit sacrifices in tactical versatility, it more than makes up for with flexible weapon loadouts that can counter any of the myriad threats an ever-evolving battlefield may present."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
