      | 54771 -> { ItemTypeData.id= 54771; name= "BlastShot Condenser Pack S"; published= true; description= "The project to adapt Arcing Vorton Projectors into ship-based weapons required the development of a high-capacity energy source for the new weapons. Ship capacitors are powerful but the immense bursts of energy required to fire Vorton Projectors called for the development of one-shot Condenser Packs capable of retaining ultra-high charges and rapidly discharging them at need. In a novel and elegant solution to the problem of cabling burnout in the projectors, the material of the Condenser Packs is designed to be rendered down into a pool of nanites the ablative nanocabling of the weapons can draw on.    Upwell's brand of BlastShot Condenser Packs are designed to deliver a pulse of power tuned to develop arcs dealing high Kinetic damage at short ranges."; marketGroupId= Some(2734); groupId= 4062; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 128; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 0.002500 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 612; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 613; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 422; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 137; value= 74.000000 }; { DogmaAttributeValueData.attributeId = 779; value= 0.500000 }; { DogmaAttributeValueData.attributeId = 114; value= 17.000000 }; { DogmaAttributeValueData.attributeId = 116; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 117; value= 116.000000 }; { DogmaAttributeValueData.attributeId = 118; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 120; value= 0.750000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.010000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 124; value= 16764120.000000 }; { DogmaAttributeValueData.attri